
<h2>Inline_response_200</h2>
<ul class="parameter">
  <li class="param-required-false">type : String
    <br/>tipo do token. Estamos usando token do tipo \&quot;bearer\&quot;
  </li>
</ul>
<ul class="parameter">
  <li class="param-required-false">token : String
    <br/>sequência de caracteres que representa o token usado para autenticação
  </li>
</ul>
<ul class="parameter">
  <li class="param-required-false">refreshToken : String
    <br/>token de atualização. Não é muito usado e geralmente vem com valor null
  </li>
</ul>
